import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import ArticlesList from './components/ArticlesList';

function App() {
  return (
    <Router>
      <div className="container">
        <Switch>
          <Route exact path="/" component={ArticlesList} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
